            "
mdl-dialog-host-component {
  width: -moz-fit-content;
  width: -webkit-fit-content;
  width: fit-content;
  height: -moz-fit-content;
  height: -webkit-fit-content;
  height: fit-content;
  padding: 1em;
  background: white;
  color: black;
  opacity: 1;
  visibility: hidden;
  display: block;
  position: fixed;
  margin: auto;
  left: 0;
  right: 0;
  transition: all;
  top: 50%;
  transform: translate(0, -50%);
}

mdl-dialog-host-component.open {
  visibility: visible;
}

"
